def exclui_tabelas(conexao):
    print("Excluindo tabelas...")
    cursor = conexao.cursor()

    # Cria uma lista com todos os nomes das tabelas
    cursor.execute('SHOW TABLES')
    tabelas = cursor.fetchall()

    cursor.execute('SET foreign_key_checks= 0')

    # Exclui tabelas
    for tabela in tabelas:
        tabela_nome = tabela[0]
        cursor.execute(f'DROP TABLE {tabela_nome}')
        print(f"Tabela {tabela_nome} excluída!")

    cursor.execute('SET foreign_key_checks = 1')

    # Fecha a conexão
    conexao.commit()
    cursor.close()